import React from 'react';
import './Experience.css';
import AboutImage from '../../images/HomePage.jpeg';


const Experience = () =>{
    return(

      <section id="Experience">
        <div className='ExperienceHeader'>
          <br/>
          <span className='ExperienceHeader_span'>Experience</span>
        </div>
        <div className='Tabs'>
            <div className='IndTabs' value="Tab_1" >Software Developer Intern</div>
            <div className='IndTabs' value="Tab_2">Software Developer</div>
        </div>
        <div   className='ExperienceBody'>
          <div  id="tab_1" className='ExperienceContentMain'>
          </div>
          <div id="tab_2" className='ExperienceContentMain'>
                      </div>
        </div>
      </section>

    )
}
export default Experience;
